import React from "react";
import SearchPlace from "./map/SearchPlace";
import SearchHealingPlace from "./map/SearchHealingPlace";
import {
  Container,
  Box,
  Button,
  Grid,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Radio,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

export default function Recommend() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      {/* <Grid container spacing={3}> */}
      <Grid item xs={4}></Grid>
      <Grid item xs={4}>
        <h1>맞춤 서비스</h1>
      </Grid>
      <Grid item xs={4}></Grid>

      <Grid item xs={3}></Grid>
      <Grid item xs={3}>
        <h2>내 주변 심리상담소</h2>
      </Grid>
      <Grid item xs={3}>
        <h2>내 주변 힐링플레이스</h2>
      </Grid>
      <Grid item xs={3}></Grid>

      <Grid item xs={3}></Grid>
      <Grid item xs={3}>
        <SearchPlace />
      </Grid>
      <Grid item xs={3}>
        <SearchHealingPlace />
      </Grid>
      <Grid item xs={3}></Grid>
      {/* </Grid> */}
    </div>
  );
}
